description:
Verenigde Staten / Canada
Komedie / Drama/ Romantiek
89 minuten

een mooie film

met Freddie Prinze Jr., Taryn Manning en Vanessa Parise

Jack is dertig en zorgt voor advertenties in New York. Hij leidt een routineleventje, boekt succes en heeft klasse. Maar hij 
loopt er verveeld bij, tot op het moment dat hij Jill ontmoet. De knappe, vurige twintigjarige vrouw komt in zijn leven en hij 
wordt stapelverliefd. Het klikt onmiddellijk tussen hen en ze beginnen een verhouding. Ze spreken af dat eerlijkheid hun 
prioriteit is. Wanneer Jill meerdere keren niet te bereiken is, eist Jack van haar dat ze hem vertelt welk geheim ze verbergt.
